function loadFromFile(file) {
    if (this.world().cssIsEnabled) {
        this.world().loadStyleSheetFromFile(file);
        this.updateEditor();
    } else {
        alert('StyleSheets module is not loaded, so CSS is not working right now.');
    }
}

270.source:
function applyWorldCSS() {
    if (!this.target || !this.target.isMorph) {
        alert('Something went wrong with setting the target morph for the CSS editor');
        return
    }
    this.target.setStyleSheet(this.get("CSSCodePane").textString);
    this.updateEditor();
    this.get("CSSCodePane").setStatusMessage('CSS applied', Color.green, 2);
}

274.source:
function updateEditor() {
    if (!this.target || !this.target.isMorph) {
        alert('Something went wrong with setting the target morph for the CSS editor');
        return
    }
    var css = this.target.getStyleSheet();
        this.get("CSSCodePane").textString =  css || '';
}

